contracts/NFTCollectionFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "@openzeppelin/contracts/proxy/Clones.sol";
import "./IDCardInterface.sol";
import "./NFTCollection.sol";

contract NFTCollectionFactory {

    function version() public pure returns(string memory V_) {
        V_ = "0.1";
    }
    // IDCard Contract address on kovan
    IDCardInterface immutable IDCard = IDCardInterface(0x44eEF5D302eCd4610872e28eEe2284f892E25dea);

    using Clones for address;

    NFTCollection public NFTLib = new NFTCollection();

    event NewNFTCollection(
        address collectionAddr,
        string collectionCreator,
        string name,
        string symbol
    );

    function newNFTCollection(
        string memory name,
        string memory symbol,
        string memory creator
    ) public {
        address collectionAddr = address(NFTLib).clone();
        NFTCollection(collectionAddr).initialize(IDCard.userId(creator), name, symbol);
        emit NewNFTCollection(collectionAddr, creator, name, symbol);
    }
}

