contracts/IDCardOwnable.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "./IDCardInterface.sol";

contract IDCardOwnable is Initializable {
    // IDCard Contract address on kovan
    IDCardInterface immutable IDCard = IDCardInterface(0x44eEF5D302eCd4610872e28eEe2284f892E25dea);

    uint256 private _ownerID;

    function __Ownable_init(uint256 ownerID_) internal onlyInitializing {
        _ownerID = ownerID_;
    }

    function owner() public view virtual returns (string memory) {
        return IDCard.username(_ownerID);
    }

    modifier onlyOwner() {
        require(msg.sender == IDCard.ownerOf(_ownerID), "IDCardOwnable: caller is not the owner");
        _;
    }
}

